import React from 'react' 
import phoneService from './services/phones'


const Phonebook=({name,number,did})=>{
    return(
        <p>{name} {number} 
        <button onClick={()=>ohrio(did)}>delete</button></p>
    )
}

const ohrio = delid =>{
    phoneService
    .delrio(delid)
    .then(App.forceUpdate())
}

export default Phonebook
